INSERT INTO `kf_notice` VALUES (13,'《8号棋牌》维护','<p style=\"padding: 0px; margin: 0px auto; color: rgb(90, 90, 90); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 33px; font-family: &quot;Microsoft YaHei&quot;; width: 605px; position: relative; word-break: normal; overflow-wrap: break-word;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, &quot;microsoft yahei&quot;; font-size: 16px;\">尊敬的《8号棋牌》玩家：</span></p><p style=\"padding: 0px; margin: 0px auto; color: rgb(90, 90, 90); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 33px; font-family: &quot;Microsoft YaHei&quot;; width: 605px; position: relative; word-break: normal; overflow-wrap: break-word; text-indent: 2em;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, &quot;microsoft yahei&quot;; font-size: 16px;\">由于客服系统维护，《8号棋牌》棋牌游戏客户端及手机端游戏平台<span style=\"padding: 0px; margin: 0px; color: rgb(192, 0, 0);\">暂停在线、电话客服服务</span>。在此期间《8号棋牌》官方网站、棋牌游戏客户端、手机端游戏正常运营。</span></p><p style=\"padding: 0px; margin: 0px auto; color: rgb(90, 90, 90); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 33px; font-family: &quot;Microsoft YaHei&quot;; width: 605px; position: relative; word-break: normal; overflow-wrap: break-word; text-indent: 2em;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, &quot;microsoft yahei&quot;; font-size: 16px;\">请各位玩家相互转告，由此给您带来的不便，敬请见谅！</span></p><p style=\"padding: 0px; margin: 0px auto; color: rgb(90, 90, 90); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 33px; font-family: &quot;Microsoft YaHei&quot;; width: 605px; position: relative; word-break: normal; overflow-wrap: break-word; text-indent: 2em;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, &quot;microsoft yahei&quot;; font-size: 16px;\">《8号棋牌》感谢所有玩家的支持和配合，祝您游戏愉快！</span></p><p style=\"padding: 0px; margin: 0px auto; color: rgb(90, 90, 90); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 33px; font-family: &quot;Microsoft YaHei&quot;; width: 605px; position: relative; word-break: normal; overflow-wrap: break-word; text-align: right;\"><span style=\"padding: 0px; margin: 0px; font-family: 微软雅黑, &quot;microsoft yahei&quot;; font-size: 16px;\">《8号棋牌》运营团队</span></p><p style=\"padding: 0px; margin: 0px auto; color: rgb(90, 90, 90); font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 33px; font-family: &quot;Microsoft YaHei&quot;; width: 605px; position: relative; word-break: normal; overflow-wrap: break-word;\"><br/></p><p><br/></p>',11),(14,'在线客服系统公告','<p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: 微软雅黑; white-space: normal;\"><span style=\"padding: 0px; margin: 0px;\">亲爱的玩家：<br/></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: 微软雅黑; white-space: normal;\"><span style=\"padding: 0px; margin: 0px;\">&nbsp; &nbsp; &nbsp;您好！</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: 微软雅黑; white-space: normal;\"><span style=\"padding: 0px; margin: 0px;\">&nbsp; &nbsp; &nbsp;由于网络波动，在线客服系统将进行临时维护抢修。届时在线服务将无法使用。维护期间，请拨打客服电话反馈问题，给您带来的不便敬请谅解！<br/></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: 微软雅黑; white-space: normal;\"><span style=\"padding: 0px; margin: 0px;\">&nbsp; &nbsp; &nbsp;感谢您一直以来对客服中心的支持，祝您游戏愉快、万事如意！</span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: 微软雅黑; white-space: normal;\"><span style=\"padding: 0px; margin: 0px;\"><br/></span></p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; font-family: 微软雅黑; white-space: normal;\"><span style=\"padding: 0px; margin: 0px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;8号棋牌运营团队&nbsp;&nbsp;</span></p><p><br/></p>',11),(15,'新春红包大派送','<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">亲爱的各位玩家朋友们：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; &nbsp; 喜迎鼠鼠年，8号棋牌游戏祝各位玩家朋友鼠年吉祥，好运如潮，意气风发，万事顺心，财源滚滚，福寿百年，吉祥平安，人旺运旺，阖家欢乐，万事如意！</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; &nbsp; 为回馈广大玩家朋友，8号棋牌推出新年红包大派送活动，百万好礼送不停，快来参与吧！</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;8号棋牌运营团队</p><p><br/></p>',11),(16,'8号棋牌游戏大师级玩家捕鱼 真心奉献','<p><span style=\"color: rgb(82, 86, 99); font-family: &quot;Microsoft YaHei&quot;; font-size: medium;\">玩捕鱼的时候最重要一点不要老盯着大鱼打，如美人鱼、鲸鱼、金钱龟等。游戏中常常遇到一些向你炮台直冲而下的鱼、这些鱼很快，遇到这些鱼，能够一般使用迎射！打鱼的两端！特别是打鲸鱼的时候、炮弹一定要打鱼的外侧羽翼、然后切换到左侧、运用连射、射中率很高、炮台的方向必须45度角上 追射鱼，假设10发炮弹还不搞定就不要再打下去浪费分了！没分的时候去捡人家喂饱子弹的鱼，这样就要比较求窍门了，你注意其他玩家、有的就是胡乱打，这就需要稳住自己的心态，不管他的炮多猛，你只需要确保你每一炮能有效的打中就可以了。进入捕鱼游戏房间刚开始会呈现一下小鱼小虾、点射就行。在炮台周围会有一些游动十分缓慢的鱼，多年经验告诉我们打鱼一定要有耐心慢慢来。</span></p>',11),(17,'营造绿色游戏环境 打击不良游戏行为','<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">《8号棋牌》为休闲游戏平台，提倡健康休闲的游戏理念，致力于营造绿色的游戏环境，严禁赌博、严禁私下交易、为了鼓励用户积极向上，益智会友，提高游戏的趣味性和耐玩性，以增加游戏乐趣，游戏金币仅为游戏中使用的虚拟游戏货币，游戏币为游戏消耗品，呼吁玩家不要去私下买卖。虚拟游戏币不具备市场交易价值。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; 经游戏玩家举报私下交易游戏虚拟游戏币的，一经查证即做没收金币、永久封号的处理，玩家之间私下进行虚拟财富积分以及帐号等交易行为，一切风险损失由玩家个人自主承担，本平台不予以承担任何形式的补偿责任。<br/></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; 8号棋牌游戏再次重申：游戏币为游戏消耗品，不具备市场交易价值，呼吁玩家不要去私下买卖。同时，8号棋牌游戏将积极配合相关部门针对部分非法组织及个人予以打击！<br/></p><p><br/></p>',11);
