INSERT INTO `kf_questions` VALUES (15,'我的密码和账号都是输入正确的，重新登录为什么会提示密码错误或不存在账号？','<p>亲爱的玩家您好！建议您在登录框内清除记录后关闭登录框，然后再次登录。感谢您对《8号棋牌游戏》的支持，祝您游戏愉快！</p>',11),(16,'目前官方提供哪些充值方式？','<p>目前有充值方式有:银行转账、网银快捷支付、微信转账、微信扫码、微信红包、支付宝转账、支付宝扫码、支付宝红包、qq钱包、京东钱包、财付通转账、百度钱包、云闪付。</p>',11),(17,'会员资格能转移吗？','<p>会员资格一旦购买就不能转移了。</p>',11),(18,'密码要怎么填写才算安全？','<p>填写密码时使用数字、字母大小写、符号混合来填写能在一定程度上提高您的密码安全程度。</p>',11),(19,'如何防止账号密码被盗用？','<p>（1）妥善保管您的账号和密码，在网吧等公共场所上网玩游戏或登陆游戏时，请不要勾选记住密码选项，同时不要让其它人有机会知道您的账号和密码。</p><p>（2）不定期更改密码，可以有效防止您的游戏账号、密码遭人盗用。</p><p>（3）游戏中如遇到有人冒充网管索取帐号密码，可以告知客服，管理人员将会立刻采取行动，千万不要把游戏密码告诉对方。</p><p><br/></p>',11),(20,'怎么使用多个ID登录？','<p>为了公平游戏，8号棋牌游戏平台目前不支持多个ID同时登录游戏。</p>',11),(21,'如何在游戏中使用托管功能？','<p>目前大部分游戏有托管功能，如果该游戏开通托管功能，您可以尝试在游戏界面查找，界面的右下角有一个托管的按钮,您可以点击进行托管。</p>',11),(22,'发的牌不好，总是输？','<p>游戏中所有牌型都是随机发放。牌型对于每个用户来说都是公平的，并不会因为某一个用户而发出特定的牌型。大家上网游戏的目的，主要是“增智逸情”。</p>',11),(23,'在游戏当中，我觉得这盘悬殊太大，没希望赢，想直接开始下一盘，能怎么办呢？','<p>如果您在游戏当中遇到这样的情况，您可以点击退出键，您点击退出键后再次进入可以直接开始新一轮的游戏。</p>',11),(24,'忘记账号，只记得昵称，能否找回？','<p>8号棋牌游戏账号为用户身份唯一基本标示，无法通过用户昵称或密码等信息查询8号棋牌游戏账号，记得数字ID也可以提供我们帮您查询账号，如果您的账号和数字ID都忘记，建议您通过以往的好友或邮件等资料回忆，也可以申请新的账号进行游戏。</p>',11),(25,'为什么游戏经常在更新？','<p>我们的每一次更新都是为了玩家游戏的稳定体验，一切为了保证玩家更好的游戏体验。</p>',11),(26,'游戏经常卡顿怎么办？','<p>建议您经常清理手机内存，部分游戏平台在客户端上也有“一键缓存”功能键，可以帮助您提升游戏稳定性。</p>',11),(27,'在游戏中遇到问题怎么办？','<p>您在游戏中遇到任何问题，导致您的游戏受到影响，请您及时联系我们的在线客服人员，我们的工作人员24小时为您服务！</p>',11),(28,'在你们平台注册账号安全吗？','<p>请您放心，我们是合法公司，安全有保障，绝不会向第三方透露您的任何个人信息！我们以诚信的态度面对每一位玩家，用户的满意和信任，是我们服务的宗旨！请你放心在我们平台注册账号进行游戏！</p>',11),(29,'充值之后没有到账要怎么办呢？','<p>充值成功后，请您刷新，确认金币是否到账，如果没到账，请您联系客服的工作人员为您处理！我们客服24小时在线为您服务。</p>',11),(30,'如何推荐朋友玩8号棋牌游戏？推荐后有什么好处？','<p>每个玩家注册成功后在官网推广页面有推广链接，您可以复制您的推广链接给您的朋友或者亲人，您的朋友或者其他玩家通过您的链接注册成功后，您将获得推广值；作为推荐人，您每推荐一个玩家，都可以获得相应丰厚奖励，您推荐的玩家在游戏中进行充值您将可以获得佣金提成。</p>',11),(31,'忘记取款密码','<p><span style=\"font-size:16px;font-family:宋体\">您好，麻烦提供一下您的会员账号，真实姓名，电话号码及绑定银行卡号，谢谢</span></p><p><br/></p>',11),(32,'账号怎么会冻结了','<p><br/></p><p>您好，会员如果连续输入10次以上错误密码时，我们系统将会自动冻结该会员账号，麻烦提供您的会员账号，真实姓名以及您绑定的银行卡卡号呢，这边为您提交到相关部门马上帮您解冻，请您以后保管好您自己的密码，谢谢!</p><p>（已经为您解冻了呢，请您注意，连续输入10次错误密码即会被系统自动冻结呢，请注意区分大小写登陆哟~~）</p>',11),(33,'修改登入密码','<p>您好！麻烦您登入游戏帐号之后，点击【会员中心】，在出现窗口的右边即可看见【修改密码】按钮，点击即可进行密码修改的操作哟~O(∩_∩)O~</p>',11);
