INSERT INTO `kf_words` VALUES (15,'您好，欢迎莅临8号棋牌，很高兴能为您提供帮助，请问有什么可以为您解答的呢？','2019-10-20 10:11:19',1,11),(16,'您好，请问您还有什么需要咨询的吗，谢谢。','2019-10-20 10:11:42',1,11),(17,'您好，我是8号棋牌客服，这里支持24小时在线存取款的网络博彩现金网，请问有什么可以帮助您的吗？','2019-10-20 10:14:04',1,11),(18,'您好，麻烦您详细描述一下您要咨询的问题，在线客服才能为您解答哦，谢谢！','2019-10-20 10:14:37',1,11),(19,'请您不要着急，我非常理解您的心情，我们一定会竭尽全力为您解决的;','2019-10-20 17:48:43',1,11),(20,'“听得出来您很着急”“感觉到您有些担心”“我能体会您到很生气，让我来给您提供其它的建议，您看好吗?”“我能感受到您的失望，我可以帮助您的是……”“我能感受得到，**情况、业务给您带来了不必要的麻烦”;','2019-10-20 17:49:51',1,11),(21,'您好，给您带来这么多的麻烦实在是非常抱歉，如果我是您的话，我也会很生气的，请您先消消气给我几分钟时间给您说一下这个原因可以吗?','2019-10-20 17:50:25',1,11),(22,'您对我们业务这么熟，肯定是我们的老客户了，不好意思，我们出现这样的失误，太抱歉了;','2019-10-20 17:50:51',1,11),(23,'先生/小姐，很抱歉之前的服务让您有不好的感受，我们平台对于客户的意见是非常重视的，我们会将您说的情况尽快反映给相关部门去做改进;','2019-10-20 17:51:30',1,11),(24,'这样做主要是为了保护您的利益;','2019-10-20 17:51:56',1,11),(25,'如果谁都可以帮您办理这么重要的业务，那对您的利益是很没有保障的;','2019-10-20 17:52:31',1,11),(26,'这次给您添麻烦了，其实，我们也挺不好意思，您所说的情况我们将记录下来，并反馈给相关部门，会尽可能避免问题的再次出现','2019-10-20 17:52:58',1,11),(27,'非常感谢您向我们提供这方面的信息，这会让我们的服务做得更好;','2019-10-20 17:53:15',1,11),(28,'感谢您对我们工作的支持，希望您以后能一如既往支持我们!','2019-10-20 17:53:28',1,11),(29,'针对您刚才所反映的情况我们平台也会不断地去改善，希望改善后能给您带来更好的服务;','2019-10-20 17:54:26',1,11),(30,'让您产生这样的疑惑，也让您生气了，实在抱歉;','2019-10-20 17:54:42',1,11),(31,'非常感谢您对我们的关心和支持，我们会尽快完善;','2019-10-20 17:55:00',1,11),(32,'您说的这些，确实是有一定的道理，如果我们能帮您一定会尽力，不能帮您的地方，也请您谅解;','2019-10-20 17:55:21',1,11),(33,'由于查询数据需要一些时间，不好意思要耽误(您)一点时间;','2019-10-20 17:56:24',1,11),(34,'感谢您耐心的等候;','2019-10-20 17:56:37',1,11),(35,'这可能是我们工作人员的失误，我们会马上反馈您这个问题，请放心，我们会给您一个满意的处理结果!','2019-10-20 17:57:10',1,11),(36,'非常抱歉，给您造成不便，请您稍等，我们马上测试一下，好吗?如确实有故障，跟客户解释:“谢谢您跟我们反映此这情况，我们会马上上报故障处理，请您稍后再试，好吗?”','2019-10-20 17:57:30',1,11),(37,'您的满意是我们的追求，祝您有个阳光好心情','2019-10-20 17:58:04',1,11),(38,'请您放心，您要求办理的退款已办理(取消)成功!请您放心，您的话费我已帮您查询过，没有问题!请您放心，您反映的问题已为您记录!','2019-10-20 17:58:43',1,11),(39,'别着急，请您慢慢讲，我会尽力帮助您的;','2019-10-20 17:58:58',1,11),(40,'希望下次有机会再为您服务!','2019-10-20 17:59:35',1,11),(41,'天气转凉了，记得加衣保暖!','2019-10-20 17:59:45',1,11),(42,'您都是